import Link from 'next/link';
import React, { ReactNode } from 'react';

const UserLink = ({
	className,
	disabled,
	children,
}: {
	className?: string;
	disabled?: boolean;
	children?: ReactNode;
}) => {
	if (disabled) {
		if (children)
			return (
				<a
					className={
						'text-yellow-400 font-medium' + (className ? ` ${className}` : '')
					}
				>
					RiznSun
				</a>
			);
	}

	const outerElem = disabled ? <div></div> : <Link href="/users/1"></Link>;
	return (
		<Link href="/users/1">
			{children && children}
			{!children && (
				<a
					className={
						'text-yellow-400 font-medium' + (className ? ` ${className}` : '')
					}
				>
					RiznSun
				</a>
			)}
		</Link>
	);
};

export default UserLink;
